Zvláštní případy: 
1. Pokud má žena menstruační cyklus dlouhý přibližně 28 dní, můžete používat tuto funkci; 
2. Ženy, jejichž menstruační cyklus je příliš kratší nebo delší, by neměly tuto funkci využívat; 
3. Období neplodných dní může ovlivnit řada faktorů, funkce této aplikace je pouze orientační, neslouží jako účinná antikoncepce.

1. Starší (nad 65 let), těhotné ženy; 
2. Pacienti s diabetem nebo jinými metabolickými chorobami; 
3. Kardiovaskulární onemocnění; 
4. Plicní nemocí; / n5. Nemoci kostí a kloubů
